/* NAVBAR - INDEX.JS */

import React from 'react';

import './style.css';

export default function NavBar() {
  return (
    <nav>
      <ul className='list'>
        <li className='items' path="/upload">Upload</li>
        <li className='items' path="/files">Files</li>
      </ul>
    </nav>
  )
}
